function HeadLine() {
  return (
    <div className='HeadLine'> 

      <div id='headerComponent'>

      <img src={`image/email-newsletter.jpeg` } alt="Headlineimage"/>
      </div>
      <div id='vr'></div>
      <div id='mainComponent'>side view</div>

    </div>
  )
}

export default HeadLine
